func TestRtmpRequest(t *testing.T) {
	ctx := core.NewContext()
	p := NewRtmpRequest(ctx)
	if p.TcUrl != "" || p.Stream != "" || p.App != "" || p.Type != RtmpUnknown {
		t.Error("invalid")
	}

	if err := p.Reparse(); err == nil {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip"
	p.Stream = "xxx"
	if err := p.Reparse(); err != nil || p.App != "__defaultApp__" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip/app___vhost=xx"
	if err := p.Reparse(); err != nil || p.Vhost != "xx" || p.App != "app" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip/app?vhost___xx"
	if err := p.Reparse(); err != nil || p.Vhost != "xx" || p.App != "app" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip/app?vhost=xx"
	if err := p.Reparse(); err != nil || p.Vhost != "xx" || p.App != "app" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip/app...vhost=xx"
	if err := p.Reparse(); err != nil || p.Vhost != "xx" || p.App != "app" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip/app?vhost...xx"
	if err := p.Reparse(); err != nil || p.Vhost != "xx" || p.App != "app" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip/app"
	p.Stream = "stream?vhost=xx"
	if err := p.Reparse(); err != nil || p.Vhost != "xx" || p.Stream != "stream" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip/app"
	p.Stream = "stream?domain=xx"
	if err := p.Reparse(); err != nil || p.Vhost != "xx" || p.Stream != "stream" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip/app"
	p.Stream = "stream...domain=xx"
	if err := p.Reparse(); err != nil || p.Vhost != "xx" || p.Stream != "stream" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip/app"
	p.Stream = "stream?domain...xx"
	if err := p.Reparse(); err != nil || p.Vhost != "xx" || p.Stream != "stream" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip/app"
	p.Stream = "stream___domain=xx"
	if err := p.Reparse(); err != nil || p.Vhost != "xx" || p.Stream != "stream" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip/app"
	p.Stream = "stream?domain___xx"
	if err := p.Reparse(); err != nil || p.Vhost != "xx" || p.Stream != "stream" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://vhost/app"
	p.Stream = "stream"
	if err := p.Reparse(); err != nil || p.Vhost != "vhost" || p.App != "app" || p.Stream != "stream" || p.Port() != 1935 {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip:1936/app"
	p.Stream = "stream"
	if err := p.Reparse(); err != nil || p.Vhost != "ip" || p.App != "app" || p.Stream != "stream" || p.Port() != 1936 || p.Host() != "ip" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip:1936/app?vhost=xxx"
	p.Stream = "stream?vhost=xxx"
	if err := p.Reparse(); err != nil || p.Vhost != "xxx" {
		t.Error("invalid")
	}

	p.TcUrl = "rtmp://ip:1936/app/sub"
	if err := p.Reparse(); err != nil || p.App != "app/sub" {
		t.Error("invalid")
	}
}

func TestRtmpMessage(t *testing.T) {
	m := NewRtmpMessage()
	m.Payload = []byte{7, 9, 3, 4, 2}

	b := m.Payload
	if b[0] != 7 || b[4] != 2 {
		t.Error("invalid")
	}

	if m.Timestamp = 100; m.Timestamp != 100 {
		t.Error("invalid")
	}

	var err error
	var o core.Message
	if o, err = m.ToMessage(); err != nil {
		t.Error("invalid", err)
	}

	var ok bool
	var om *OryxRtmpMessage
	if om, ok = o.(*OryxRtmpMessage); !ok {
		t.Error("invalid")
	}
	if om.Timestamp() != 100 {
		t.Error("invalid")
	}

	cp := om.Copy()
	if cp.Timestamp() != 100 {
		t.Error("invalid")
	}

	if cp.SetTimestamp(200); cp.Timestamp() != 200 || om.Timestamp() != 100 {
		t.Error("invalid")
	}

	if cp.rtmp.Payload[0] != 7 {
		t.Error("invalid")
	}
	if om.rtmp.Payload[0] != 7 {
		t.Error("invalid")
	}

	// the Buffer shares the bytes.
	if cp.rtmp.Payload[0] = 8; cp.rtmp.Payload[0] != 8 {
		t.Error("invalid")
	}
	if om.rtmp.Payload[0] != 8 {
		t.Error("invalid")
	}

	// when write, copy the slice
	cp.rtmp.Payload = []byte{3, 2, 1}
	if len(cp.rtmp.Payload) != 3 {
		t.Error("invalid")
	}
	if len(om.rtmp.Payload) != 5 {
		t.Error("invalid")
	}
}

